collect() {

  try {

    // grab latest state

    const recollect = this.collector();

    if (!deepEqual(recollect, this.collected)) {

      this.collected = recollect;

      if (this.onChange) {

        this.onChange(this.collected);

      }

    }

  } catch (error) {

    console.warn(error);

  }

}
